	const {isAdmin} = useContext(InfoContext);

	console.log(isAdmin);

	return (
		<Route {...rest} render={(props) => (
			true ? <Component {...props} />
			: <Redirect to="/" />
		)} />
	)
}

export default PrivateRoute;
